import React,{useEffect} from 'react';

import {useDispatch} from 'react-redux';
import {useSelector} from 'react-redux';
import {fetchCountries} from '../ducks/countries';
import {Input, Select} from 'antd';

function CountryPicker(){

    const dispatch = useDispatch();


    useEffect(()=>{

        dispatch(fetchCountries());

    },[])

    const countries = useSelector((store)=>{

        return store.countries.countries;

    })

    console.log(countries)

    return(

        <Input.Group style={{width:"25%"}}>
      <Select defaultValue="Option1">
        <Select.Option value="Option1">Countries...</Select.Option>
        {countries.map((item,index)=>{

        return <Select.Option value={item.index}>{item.name}</Select.Option>

        })}
      </Select>
      </Input.Group>
    )
}

export default CountryPicker;
